.logo {
    width: 6.6875rem;
    object-fit: contain;
    object-position: 0.3125rem 0.1875rem;
}

.header {
    position: absolute;
    width: 100%;
    z-index: 100;
    display: flex;
    align-items: center;
    justify-content: center;
    background-color: black;
    min-height: 3.125rem;
}

.loggedIn {
    position: absolute;
    width: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
    background-color: rgba(0, 0, 0, 0);
    min-height: 3.125px;
    z-index: 100;
}

.headerInner {
    display: flex;
    justify-content: space-between;
    align-items: flex-end;
    width: 95%;
}

.left {
    display: flex;
    align-items: center;
    justify-content: center;
}

.right {
    display: flex;
    align-items: center;
    gap: 10px;
}

.authLinks {
    background-color: black;
    border: solid 1px gray;
    border-radius: 3px;
    padding: 9px 24px;
    font-weight: bolder;
    transition: 0.15s;
}

.authLinks:hover {
    background-color: rgb(56, 56, 56);
}

.logoSmall {
    display: none;
    width: 2.5rem;
    object-fit: contain;
    object-position: 5px 3px;
}

@media screen and (max-width: 375px) {
    .headerText {
        display: none;
    }

    .logoSmall {
        display: block;
    }

    .logo {
        display: none;
    }
}

.headerText {
    font-family: Arial, Helvetica, sans-serif;
    font-size: 11px;
    font-weight: lighter;
}

.profileImage {
    width: 3.125rem;
}

.drowdownArrow {
    width: 15px;
}

.profile {
    display: flex;
    justify-content: center;
    align-items: center;
    gap: 1rem;
    cursor: pointer;
}

.searchIcon {
    width: 1.5625rem;
}

.searchClose {
    transition: all 0.5s ease;
    transform: scaleX(0);
    transform-origin: right;
}

.searchOpen {
    transition: all 0.5s ease;
    transform: scaleX(1);
    transform-origin: right;
}

.searchDefault {
    background-color: rgb(0, 0, 0, 0);
    border: solid #ccc 1px;
    border-radius: 2px;
}

.searchDefault:focus {
    border: solid #ccc 1px !important;
    border: 2px !important;
}

.dropdown {
    opacity: 1;
    transition: all 0.5s ease;
    display: flex;
    flex-direction: column;
    align-items: center;
    position: absolute;
    top: 60px;
    right: 20px;
    border: solid rgb(58, 58, 58);
    border-top: solid white;
    background-color: rgb(25, 25, 25);
}

.show {
    opacity: 0;
}

.line {
    width: 100%;
    border: solid 2px rgb(58, 58, 58);
    margin: 5px 0px 10px;
}

.innertext {
    display: flex;
    overflow: hidden;
    flex-direction: column;
    cursor: default;
    width: 9.375rem;
    margin: 8px;
    padding: 10px;
    row-gap: 3px;
}
